import React from 'react';

import './styles.css'

function name({name}) {
  return (
    <div />
  )
}


export default function Cart({ url, img }) {
  return (
    <>

      <a href={url}>
      </a>
        <img onMouseOver={name('jadson')} src={img} alt="picture image" />
    </>
  )
}
